import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPlus, faCircleCheck, faEllipsisV, faPenToSquare, faCircleXmark } from "@fortawesome/free-solid-svg-icons";
import Modules from "../Modules";
import './style.css'

export default function Home() {
  library.add(faCircleXmark, faCircleCheck);

  return (
    <>
      <div class="page-body-inner flex-fill">
        <Modules />
      </div>
      <div className="right-sidebar">
        <div className="d-flex flex-column">
          <div>Course Status</div>
          <div className="d-flex flex-row mb-3 ">
            <button type="button" class="btn btn-secondary flex-fill" onclick="">
              <FontAwesomeIcon icon={faCircleXmark} />
              Unpublish
            </button>
            <button type="button" class="btn btn-success flex-fill" disabled onclick="">
              <FontAwesomeIcon icon={faCircleCheck} />
              Published
            </button>
          </div>
        </div>
      </div>

    </>
  );
}
